import Reac, { useState } from 'react';
import { DiApple } from 'react-icons/di';

function AppleIcon() {
  const [navbarOpen, setNavbarOpen] = useState(false);

  const handleToggle = () => {
    setNavbarOpen(!navbarOpen);
  };

  return (
    <div onClick={handleToggle} className="">
      <DiApple />
    </div>
  );
}

export default AppleIcon;
